		function autoplayHomeHeader(){
			fadeOutHeader();
			jQuery("div#featureItemControls ul li.active").removeClass("active");
			if (intCurrentHomeHeaderSlide < intNumberOfItems-1){
				intCurrentHomeHeaderSlide++;
			} else {
				intCurrentHomeHeaderSlide = 0;
			}
			jQuery("div#featureItemControls ul li:eq(" + intCurrentHomeHeaderSlide + ")").addClass("active");
			fadeInHeader();
		}
		function showHeaderItem(whichItem){
			if (whichItem != intCurrentHomeHeaderSlide){
				clearInterval(objHomeHeaderInterval);
				fadeOutHeader();
				intCurrentHomeHeaderSlide = whichItem;
				fadeInHeader();
			}
		}
